from os import mkdir, chdir, listdir
from datetime import datetime
from base64 import b64decode
from threading import Thread
from random import choice
from requests import get
from json import loads
from time import sleep
from sys import argv
import argparse

def save_file(file_url, filename):

	if filename in listdir():
		split_filename = filename.split(".")
		for i in range(2, 100):
			check_name = "%s (%i).%s" % (split_filename[0], i, split_filename[1])
			if check_name not in listdir():
				filename = check_name
				break
	try:
		file = open(filename, "wb")
		file.write(get(file_url).content)
		file.close()
	except Exception as error:
		print("[!] File save error: %s, file:%s, URL:%s." % (str(error), filename, file_url))

def save_thread(thread_url, current_post):

	error_404 = 0
	first_launch = True
	total_file = 0

	while 1:
		res = get(thread_url.replace(".html", ".json"))

		if res.status_code == 200:

			try:
				for post in loads(res.text)["threads"][0]["posts"][current_post:]:
					current_post = current_post + 1
				
					if post["files"] == []:
						print("[%s POST:%i] without files." % (datetime.fromtimestamp(post["timestamp"]).strftime("%H:%M:%S"), current_post))
					else:
						print("[%s POST:%i] with %i files." % (datetime.fromtimestamp(post["timestamp"]).strftime("%H:%M:%S"), current_post, len(post["files"])))

						for file in post["files"]:
							if first_launch:
								if total_file == 100:
									total_file = 0
									sleep(3)
								else:
									total_file = total_file + 1
							if file["displayname"] == "Стикер":
								file_link = "https://2ch.hk/stickers/%s/%s" % (file["pack"], file["name"])
								print("\t\tDownloading:%s..." % (file["name"]))
								Thread(target = save_file, args = (file_link, file["name"])).start()
							else:
								print("\t\tDownloading:%s..." % (file["displayname"]))
								Thread(target = save_file, args = ("https://2ch.hk"+file["path"], file["fullname"].replace("[...]", ""))).start()

					first_launch = False

			except Exception as error:
				print("[!] Parsing error: %s\n[LAST POST] %s" % (str(error), str(post)))
				continue

		elif res.status_code == 404:
			if error_404 != 2:
				error_404 = error_404 + 1
				print("[%s] Requests status code: 404, maybe thread will be closed. Sleeping for %i seconds." % (thread_url, error_404*3))
				sleep(error_404*3)
			else:
				print("[%s] Requests status code: 404, and too many trying for request !" % (thread_url))
				return 0


def main():

	parser = argparse.ArgumentParser(description='2ch API thread saver 2.0')
	parser.add_argument('-U', '--url', type=str, default="",  help = "Thread URL.")
	parser.add_argument('-D', '--dir', type=str, default="", help = "Directory for save files.")
	parser.add_argument('-P', '--post', type=int, default=0, help = "Post from which to start parsing.")
	my_namespace = parser.parse_args()

	if my_namespace.url == "":
		print(get_art())
		print("\t\n")
		return 0

	if my_namespace.dir == "":
		directory = datetime.now().strftime("%Y-%m-%d ") + " " + my_namespace.url.split("/")[-1].split(".")[0]
		if directory in listdir():
			chdir(directory)
		else:
			mkdir(directory)
			chdir(directory)	
		print('[+] Files will be saved in "%s"' % (directory))
	else:
		try:
			if my_namespace.dir in listdir():
				chdir(my_namespace.dir)
			else:
				mkdir(my_namespace.dir)
				chdir(my_namespace.dir)
			print('[+] Files will be saved in "%s"' % (my_namespace.dir))
		except Exception as error:
			print("[!] Directory error: %s" % (str(error)))
			directory = datetime.now().strftime("%Y-%m-%d ") + " " + my_namespace.url.split("/")[-1].split(".")[0]
			if directory in listdir():
				chdir(directory)
			else:
				mkdir(directory)
				chdir(directory)
			print('[+] Files will be saved in "%s"' % (directory))
	try:
		save_thread(my_namespace.url, my_namespace.post)
	except KeyboardInterrupt:
		print("ByBy:*")

